import React from 'react';
import { Box, AppBar, Toolbar, IconButton, Typography, ThemeProvider, CssBaseline } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { Provider } from 'react-redux';
import { store } from './store/index';
import { theme } from './theme';
import MainContent from './components/MainContent';

function AppContent() {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" color="primary">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1, fontWeight: 'bold' }}>
            KAVAS CAPITAL
          </Typography>
        </Toolbar>
      </AppBar>
      <MainContent />
    </Box>
  );
}

const App: React.FC = () => {
  return (
    <Provider store={store}>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <AppContent />
      </ThemeProvider>
    </Provider>
  );
};

export default App;
